Or I can use React's cloneElement like this:
```
const MyComponent = (props) => {
  return (
    <div>
      <p>MyComponent</p>
      <p>{props.text}</p>
    </div>
  );
};

const App = () => {
  return (
    <div>
      <MyComponent text="Hello World" />
    </div>
  );
};
```
I'm not sure when I should use cloneElement in comparison to passing properties directly to a React component. When should I use React's cloneElement in comparison to passing properties directly to a React component?

## Answer

The cloneElement function is used to create a new element with the same type as the original element, but with different props. This can be useful when you want to create a new element with the same type as the original element, but with different props.

For example, let's say you have a component called MyComponent that takes a prop called text . You can create a new element with the same type as MyComponent , but with a different text prop, like this:
```
const newElement = React.cloneElement(MyComponent, { text: 'Hello World' });
```
This will create a new element with the same type as MyComponent , but with a different text prop. You can then render this new element in your app.

